import React, { Component } from 'react'

export class Useritem extends Component {
    constructor(){
        super();
        this.state = {
            id : 'id',
            login : 'kaka'
        }
    }
    
    render() {
        return (
            <div>
              User Item
            </div>
        )
    }
}

export default Useritem
